'//',
'{UXPRERENDEREDALIAS}_DlgObj.phoneGapDeleteFilesNotInListURL = function(dirpath, matchRegex, keepList, onCompletion, onError) {',
'   if (!{UXPRERENDEREDALIAS}_DlgObj.phoneGapFilesAvailable()) {',
'      onError();',
'      return;',
'   }',
